import logo from './logo2.png';
import '../css/App.css';
import './responsive';
import {AppBar, Button, IconButton, Toolbar, Typography} from "@material-ui/core";
import React from "react";
import MenuIcon from '@material-ui/icons/Menu';
import LoginIcon from '@material-ui/icons/ExitToApp';

import { BrowserRouter as Router, Route, Link, Switch  } from "react-router-dom";

import AboutUs from "../About";
import Home from "../home";
import ContactUs from "../contact";
import MyEstimates from "../sketch";
import useStyles from "../sketchHelper/useStyles";
import login from "../auth/login";

// const useStyles = makeStyles((theme) => ({
//     root: {
//         flexGrow: 1,
//         background : '#ffffff',
//     },
//     menuButton: {
//         marginRight: theme.spacing(2),
//     },
//     title: {
//         flexGrow: 1,
//     },
// }));



// <Button><Link to="/">Home</Link></Button>
// <li><Link to="/sketch">Sketch</Link></li>
// <li><Link to="/about">About</Link></li>
// <li><Link to="/contact">Contact</Link></li>

const About_Us = () =>  <div>   <AboutUs />   </div>
const HomePage = () => <div> <Home /> </div>;
const Sketch = () => <div> <MyEstimates/>     </div>;
const Contact = () => <div>     <ContactUs />  </div>;

    const Login = () => <div> hi </div>;


function Nav() {

    const classes = useStyles();


    const NavBr = () => (

        <div className={classes.root}>
            <AppBar position="static" style={{ background : '#ffffff'}}  >
                <Toolbar style={{Background : "white"}}>
                    <IconButton edge="start" className={classes.menuButton} color="#4E4141" aria-label="menu">
                        <MenuIcon />
                    </IconButton>
                    <Link to="/" style={{textDecoration: 'none'}}>   <IconButton>
                        {/*<img src={logo} height={1} alt="logo" />*/}
                    </IconButton></Link>
                    <Typography variant="h6" className={classes.title}>

                        <Link to="/sketch" style={{textDecoration: 'none'}}>
                        <Button>


                            Sketch App
                        </Button>
                        </Link>
                        <Link to="/contact" style={{textDecoration: 'none'}}>
                        <Button>

                            Contact us
                        </Button>
                        </Link>
                        <Link to="/about" style={{textDecoration: 'none'}}>
                            <Button>

                            About us

                        </Button>

                        </Link>

                    </Typography>
                    <Link to="/login" style={{textDecoration: 'none'}}>

                    <Button color="#4E4141">Login</Button>

                    </Link>
                    <Link to="/login" style={{textDecoration: 'none'}}>

                    <IconButton color="#4E4141">
                        <LoginIcon />

                    </IconButton>
                    </Link>
                </Toolbar>
            </AppBar>
        </div>
    );


    return (
        <>
            <Router>

                <NavBr />
                <Switch>
                <Route exact path="/" component={HomePage} />
                <Route path="/about" component={About_Us} />
                    <Route path="/contact" component={Contact} />
                    <Route path="/sketch" component={Sketch} />
                    <Route path="/login" component={Login} />
                </Switch>
            </Router>

        </>
    )
}
export default Nav;
